import { AppBar, Toolbar, Box, styled } from '@mui/material';

const StyledHeader = styled(AppBar)`
    background: #2874f0;
    height: 55px;
`;

const Header = () => {
    return (
        <>
            <StyledHeader position="static">
                <Toolbar>
                    <Box></Box>
                </Toolbar>
            </StyledHeader>
        </>
    );
};
export default Header;
